import { useForm } from 'react-form-simple';

export default function App() {
  const { render } = useForm({ name: 'name' });

  return render('name', {
    rules: [
      { required: 'Please Input' },
      {
        validator(value) {
          return String(value).length > 9 ? 'Max Limit' : '';
        },
      },
    ],
  })(<input />);
}
