import { useForm } from 'react-form-simple';

export default function App() {
  const { render, useWatch } = useForm({ name: 'name', age: '' });

  useWatch(
    ({ model }) => [model.name, model.age],
    (newValue, preValue) => {},
  );

  return (
    <>
      {render('name')(<input />)}
      {render('age')(<input />)}
    </>
  );
}
